import React from "react";
import { Link, NavLink } from "react-router-dom";
import Footer from "../components/Footer";
import Formulaire from "../components/Formulaire";
import Navigation from "../components/Navigation";
import Missions from "./Missions";

const Home = () => {
  return (
    <main>
      <header>
        <Navigation />
      </header>
      <section>
        {/* Formulaire juste pour le test */}
        <div className="home">
          <Formulaire />
        </div>
      </section>
      <section>
        <NavLink to={Missions} className="left hover">
          <span>Je veux aider</span>
        </NavLink>
        <Link to={`/user`} activeClassName="active">{user.name}</Link>
        <NavLink to={Missions} className="right hover">
          <span>J'ai besoin d'aide</span>
        </NavLink>
      </section>

      <footer>
        <Footer />
      </footer>
    </main>
  );
};

export default Home;
